// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

contract MerkleVoting {
    address public admin;
    uint public candidatesCount;
    bool public votingOpen;
    bytes32 public merkleRoot;

    struct Voter {
        bool hasVoted;
        uint candidateId;
    }

    mapping(address => Voter) public voters;
    mapping(uint => uint) public candidates; // candidateId => voteCount

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action.");
        _;
    }

    modifier votingActive() {
        require(votingOpen, "Voting is not currently open.");
        _;
    }

    constructor() {
        admin = msg.sender;
        votingOpen = false;
    }

    // Start the voting process
    function startVoting() public onlyAdmin {
        votingOpen = true;
    }

    // End the voting process
    function endVoting() public onlyAdmin {
        votingOpen = false;
    }

    // Register a new candidate
    function registerCandidate() public onlyAdmin {
        candidatesCount++;
    }

    // Set the Merkle root
    function setMerkleRoot(bytes32 _merkleRoot) public onlyAdmin {
        merkleRoot = _merkleRoot;
    }

    // Vote for a candidate with Merkle proof verification
    function vote(
        uint _candidateId,
        bytes32[] memory proof
    ) public votingActive {
        require(!voters[msg.sender].hasVoted, "You have already voted.");
        bytes32 leaf = keccak256(abi.encodePacked(msg.sender, _candidateId));
        require(
            MerkleProof.verify(proof, merkleRoot, leaf),
            "Invalid vote or Merkle proof."
        );

        voters[msg.sender] = Voter(true, _candidateId);
        candidates[_candidateId]++;
    }

    // Get the vote count of a candidate
    function getCandidateVotes(uint _candidateId) public view returns (uint) {
        return candidates[_candidateId];
    }
}

